    false,nt"url": null,nt"notes": "This narrative report details the conditions
    and management of Stillwater Wildlife Management Area from May through August of
    1949. The report begins with general information about weather and water conditions
    on the refuge. The second section of the report describes wildlife on the refuge
    and includes migratory birds, upland game birds, big game animals, fur animals,
    predaceous birds, and fish.  The report then covers the refugeu2019s development
    and maintenance projects. The last two sections of the report describe field investigations
    and research and public relations; a list of refuge visitors is given.  Finally,
    N-R forms and photographs are provided.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
